import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getThumbNails } from "../actions";

// eslint-disable-next-line
// import css from "../css/storeGrid.css";

const StoreGrid = ({ getThumbNails, thumbNails }) => {
  useEffect(() => {
    getThumbNails();
    // eslint-disable-next-line
  }, []);

  const renderImages = () => {
    return thumbNails.map((item) => {
      return (
        <div className='row-cols-auto'>
          <div className='col'>
            <img src={item.image} alt={item.image} key={item.id} />
            <h6>{item.title}</h6>
            <h5>${item.price}</h5>
          </div>
        </div>
      );
    });
  };

  return <div className='container'>{renderImages()}</div>;
};

const mapStateToProps = (state) => {
  return {
    thumbNails: state.thumbNails,
  };
};

export default connect(mapStateToProps, {
  getThumbNails,
})(StoreGrid);
